import React from "react";
import "../css/index.comp.css";

const ContactUs = () => {
  return (
    <div className="page-content">
      <h2>Contact Us</h2>
      <form className="book">
        <label>Name</label>
        <input type="text" name="name" />
        <label>Farm Name</label>
        <input type="text" name="farmName" />
        <label>Contact Number</label>
        <input type="text" name="contactNumber" />
        <label>Address</label>
        <input type="text" name="address" />
        <label>Pincode</label>
        <input type="text" name="pincode" />
        <label>Email (optional)</label>
        <input type="email" name="email" />
        <label>GSTIN Number (optional)</label>
        <input type="text" name="gstinNumber" />
      </form>
      <p>Customer Care Number: +91-9109410160</p>
      <p>Email: info@alphamuscle.in</p>
      <p>Address: G-1/1155, Man Sarovar Park, Delhi - 110032</p>
      <p>For Bulk Orders/Sales: alphamuscle4@gmail.com</p>
    </div>
  );
};

export default ContactUs;
